        phoneNumberField.on({
            focus: function(){
                if ($(this).val().length >= 14) {
                    inputSubmit.addClass('active');
                } else {
                    inputSubmit.removeClass('active');
                }
            },
            input: function(){
                if ($(this).val().length >= 14) {
                    inputSubmit.addClass('active');
                } else {
                    inputSubmit.removeClass('active');
                }
            },
            change: function() {
                if ($(this).val().length >= 14) {
                    inputSubmit.addClass('active');
                } else {
                    inputSubmit.removeClass('active');
                }
            }
        });

